script: |
  super -f text -I q10730.spq | sort > q10730.out

inputs:
  - name: q10730.spq
    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) WHERE NOT + + col1 NOT IN ( - 15, ( + - col2 ) * + col1 + + - col1 + col2 * - 39, - + col2, + + col1 );
  - name: tab1

outputs:
  - name: q10730.out
    data: |
      51	14	96
      85	5	59
      91	47	68
